import React from 'react'
import '../style/posts.css'
import Post from './Post'
export default function Posts(posts) {
  return (
    <div className='posts'>
      {posts.map(post => {
        <post />
      })}
      <Post />
      <Post />
      <Post />
      <Post />
      <Post />
      <Post />
    </div>
  )
}
